def find_optimal_ship_cell(n, k, field):
    poss = [[0] * n for _ in range(n)]
    for i in range(n):
        for j in range(n - k + 1):
            good = True
            for ell in range(k):
                if field[i][j + ell] == '#':
                    good = False
                    break
            if good:
                for ell in range(k):
                    poss[i][j + ell] += 1
    for j in range(n):
        for i in range(n - k + 1):
            good = True
            for ell in range(k):
                if field[i + ell][j] == '#':
                    good = False
                    break
            if good:
                for ell in range(k):
                    poss[i + ell][j] += 1
    best = 1
    besti = 0
    bestj = 0
    for i in range(n):
        for j in range(n):
            if best < poss[i][j]:
                best = poss[i][j]
                besti = i
                bestj = j
    return (besti + 1, bestj + 1)

